import { useState } from "react";

const Home = () => {

    const [persons , changeInfos] = useState([
        {name: 'qmars', gender: 'he', city: 'toronto', age: 18, nativeAmerican: false, id: 0},
        {name: 'amitis', gender: 'she', city: 'seatle', age: 18, nativeAmerican: false, id: 1},
        {name: 'joe', gender: 'he', city: 'chicago', age: 21, nativeAmerican: true, id: 2}
    ]);


    return ( 
        <div className="home">
            {persons.map((person) => (
                <div className="showCase" key={person.id}>
                    <h1>{person.name}</h1>
                </div>
            ))}
        </div>
     );
}
 
export default Home;
